import React, { useState, useEffect, useRef } from 'react';
import axios from '../service/axiosConfig'; 
import { auth } from '../service/firebaseConfig';
import { useNavigate } from 'react-router-dom';
import { Button } from 'primereact/button';
import { Dialog } from 'primereact/dialog';
import { DataTable } from 'primereact/datatable';
import { Column } from 'primereact/column';
import { Toast } from 'primereact/toast';

const Protected = () => {
  const [loading, setLoading] = useState(false);
  const [products, setProducts] = useState([]);
  const [selectedProducts, setSelectedProducts] = useState([]);
  const [productDialog, setProductDialog] = useState(false);
  const [deleteProductDialog, setDeleteProductDialog] = useState(false);
  const [product, setProduct] = useState({});
  const [submitted, setSubmitted] = useState(false);
  const toast = useRef(null);
  const navigate = useNavigate();
  const dt = useRef(null);

  const emptyProduct = {
    id: '',
    name: '',
    description: '',
    price: 0,
  };

  const fetchProductos = async () => {
    setLoading(true);
    try {
      const response = await axios.get('/api/productos'); 
      setProducts(response.data);
    } catch (error) {
      console.error('Error al obtener los productos:', error);
      if (error.response && error.response.status === 403) {
        navigate('/auth/login'); 
      }
    }
    setLoading(false);
  };

  const verifyUser = async () => {
    const user = auth.currentUser;
    if (!user) {
      navigate('/auth/login');
    } else {
      const token = await user.getIdToken(); 
      try {
        const response = await axios.post("/auth/login", { firebaseToken: token });
        if (response.data.userRole === 'admin') {
          fetchProductos(); 
        } else {
          navigate('/'); 
        }
      } catch (error) {
        console.error("Error al verificar el usuario:", error);
        navigate('/auth/login');
      }
    }
  };
  useEffect(() => {
    const checkUserRole = async () => {
      const token = localStorage.getItem('firebaseToken');
      if (token) {
        try {
          const response = await axios.post('/auth/verifyRole', { token });
          setUserRole(response.data.userRole); 
          if (response.data.userRole !== 'admin') {
            navigate('/'); 
          }
        } catch (error) {
          console.error('Error al verificar el rol del usuario:', error);
          navigate('/auth/login');
        }
      } else {
        navigate('/auth/login');
      }
    };

    checkUserRole();
  }, [setUserRole, navigate]);
  useEffect(() => {
    verifyUser();
  }, []);

  const formatCurrency = (value) => {
    return value.toLocaleString('en-US', { style: 'currency', currency: 'USD' });
  };

  const openNew = () => {
    setProduct(emptyProduct);
    setSubmitted(false);
    setProductDialog(true);
  };

  const hideDialog = () => {
    setSubmitted(false);
    setProductDialog(false);
  };

  const hideDeleteProductDialog = () => {
    setDeleteProductDialog(false);
  };

  const saveProduct = async () => {
    setSubmitted(true);
    setLoading(true);
    setProductDialog(false);
    try {
      if (!product.id) {
        await axios.post('/api/productos', product);
      } else {
        await axios.put(`/api/productos/${product.id}`, product);
      }
      toast.current.show({ severity: 'success', summary: 'Successful', detail: 'Product Saved', life: 3000 });
      fetchProductos();
    } catch (error) {
      console.error('Error al guardar el producto:', error);
    }
    setLoading(false);
  };

  const editProduct = (product) => {
    setProduct({ ...product });
    setProductDialog(true);
  };

  const confirmDeleteProduct = (product) => {
    setProduct(product);
    setDeleteProductDialog(true);
  };

  const deleteProduct = async () => {
    setLoading(true);
    setDeleteProductDialog(false);
    try {
      await axios.delete(`/api/productos/${product.id}`);
      toast.current.show({ severity: 'success', summary: 'Successful', detail: 'Product Deleted', life: 3000 });
      fetchProductos();
    } catch (error) {
      console.error('Error al eliminar el producto:', error);
    }
    setLoading(false);
  };

  const exportCSV = () => {
    dt.current.exportCSV();
  };

  const logout = () => {
    auth.signOut().then(() => {
      navigate('/auth/login'); 
    });
  };

  return (
    <div>
      <Toast ref={toast} />
      <div className="card">
        <DataTable ref={dt} value={products} selection={selectedProducts} onSelectionChange={(e) => setSelectedProducts(e.value)} dataKey="id" paginator rows={10} rowsPerPageOptions={[5, 10, 25]}>
          <Column selectionMode="multiple" headerStyle={{ width: '3em' }}></Column>
          <Column field="name" header="Name" sortable></Column>
          <Column field="description" header="Description" sortable></Column>
          <Column field="price" header="Price" body={(rowData) => formatCurrency(rowData.price)} sortable></Column>
          <Column body={(rowData) => (
            <div>
              <Button icon="pi pi-pencil" className="p-button-rounded p-button-success mr-2" onClick={() => editProduct(rowData)} />
              <Button icon="pi pi-trash" className="p-button-rounded p-button-warning" onClick={() => confirmDeleteProduct(rowData)} />
            </div>
          )}></Column>
        </DataTable>
        <Button label="New" icon="pi pi-plus" className="p-button-success mr-2" onClick={openNew} />
        <Button label="Delete" icon="pi pi-trash" className="p-button-danger" onClick={() => setDeleteProductDialog(true)} disabled={!selectedProducts || !selectedProducts.length} />
        <Button label="Export" icon="pi pi-upload" className="p-button-help" onClick={exportCSV} />
        <Button label="Logout" icon="pi pi-sign-out" className="p-button-secondary" onClick={logout} />
      </div>
    </div>
  );
};

export default Protected;
